import React from 'react';

const Jobs = ({vagas}) => {
    return(
        <div>
            <div><img src="https://via.placeholder.com/50" alt="" /></div>
            <p>{format(new Date(vagas.data_pub), 'dd-MM-yyyy')}</p>
            <h1>{vagas.cargo}</h1>
            <span>{vagas.localidade}</span>
        </div>
    )
}

export default Jobs
